import '../css/App.css';
import { connect } from "react-redux";
import RootReducer from "../reducer/RootReducer"
import Rating from "./Rating";



export default class CarBasicInformation extends React.Component
{
  constructor(props)
  {
    super(props);
  }

  render()
  {
    return(
      <div className="RatingsAndReviews">
        <div className="Ratings">
          <p className="Car-Name">{this.props.carNameRatingsReviews.companyName}</p>
        </div>
        <div className="Path">
          <Rating RatingValue = {this.props.carNameRatingsReviews.rating} MaxRating = {5}/>
        </div>
        <p className="-Reviews">456 Reviews</p> {/* set reviews by props */}
      </div>
    );
  }
}
